I can’t believe I finished this book in less than a week. Well, I guess I am getting my groove back on.
.
The reason I picked up this book earlier this year is that this has some M/M Romance within its pages. Luckily, that was not the main ingredient of the entire story and was simply an added spice for more flavour.
.
The story was mostly about twin brothers who grew up with dreams of being a Spell Walker—the name of the group of superheroes in this story—and when one of them suddenly manifests abilities that they don’t have before, their entire family and brotherhood are shooked to the core.
.
As usual, it took me more than a hundred pages to actually enjoy this book, but it was during those first few pages that got me hooked and took me away from playing games or browsing on my phone.
.
If you are into Harry Potter, X-Men, and the Grishaverse, then this book (or series, rather) is definitely a must-read for you. 
