⭐️⭐️⭐️⭐️⭐️

Colleen Hoover, ladies and gentleman - she’s done it again 👏🏻👏🏻👏🏻 

I loved Heart Bones. No surprise there, really. Colleen Hoover knows just how to break my heart into a million pieces and put it back together again (usually better than when she found it in the first place) 💗 

Heart Bones is more YA than adult fiction. YA is usually not my favorite, but this was a hit for me! 

A few things: 

✨ I loved that this book has a family piece to it - it’s not just a romance
✨ Reminded me a little of Hopeless with some of Ugly Love thrown in 
✨ Beyah is such a strong female lead - I adored her // loved Samson, too! 
✨ Pepper Jack Cheese 😍 (iykyk) 
✨ Did the setting remind anyone else of Outer Banks, the Netflix show?? Maybe because it’s set at the beach and there are characters named Sara and Topher but I totally pictured Outer Banks scenery while reading 

